// src/App.js (Asegúrate de importar y usar AuthProvider)
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css'; 

// Importa el proveedor de autenticación
import { AuthProvider } from './contexts/AuthContext'; 

import Navbar from './components/Navbar/Navbar'; 
import Footer from './components/Footer/Footer'; 
import WhatsAppButton from './components/WhatsAppButton/WhatsAppButton';
// import ParticlesBackground from './components/ParticlesBackground/ParticlesBackground';

import Home from './pages/Home';
import Login from './components/Login/Login';
import Register from './components/Register/Register';


function App() {
  return (
    // Envuelve la aplicación con el AuthProvider
    <AuthProvider>
        <Router>

            {/* <ParticlesBackground /> */} 

            <div className="app-container">

                <Navbar />

                <main className="main-content">
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/acceso" element={<Login />} />
                        <Route path="/registro" element={<Register />} />
                        {/* Rutas futuras protegidas */}
                        {/* <Route path="/servicios" element={<ProtectedRoute><Services /></ProtectedRoute>} /> */}
                        {/* <Route path="/tienda" element={<ProtectedRoute><Shop /></ProtectedRoute>} /> */}
                        {/* <Route path="/perfil" element={<ProtectedRoute><Profile /></ProtectedRoute>} /> */}
                    </Routes>
                </main>

                <Footer />
                <WhatsAppButton />

            </div>
        </Router>
    </AuthProvider>
  );
}

export default App;
